import { NowRequest, NowResponse } from '@vercel/node';
import ScrapperFifaArena from './BotFifaArena/ScrapperFifaArena';

export default async (resquest: NowRequest, response: NowResponse) => {
  const contentHTML = await ScrapperFifaArena.getJSONData();
  return response.json(await ScrapperFifaArena.getJSONData());
}
